import React from 'react'
import { Nav } from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'
import { Link } from 'react-router-dom'



function CheckoutSteps({ step1, step2, step3, step4 }) {
    return (
        <Nav className='justify-content-center md-4'>
            <Nav.Item>
                {step1 ? (
                    <LinkContainer to='/login'>
                        <Nav.Link>Логин</Nav.Link>
                    </LinkContainer>
                )      : (
                    <Nav.Link disabled>Логин</Nav.Link>
                )}
            </Nav.Item>

            <Nav.Item>
                {step2 ? (
                    <LinkContainer to='/shipping'>
                        <Nav.Link>Доставка</Nav.Link>
                    </LinkContainer>
                )      : (
                    <Nav.Link disabled>Доставка</Nav.Link>
                )}
            </Nav.Item>

            <Nav.Item>
                {step3 ? (
                    <LinkContainer to='/payment'>
                        <Nav.Link>Оплата</Nav.Link>
                    </LinkContainer>
                )      : (
                    <Nav.Link disabled>Оплата</Nav.Link>
                )}
            </Nav.Item>

            <Nav.Item>
                {step4 ? (
                    <LinkContainer to='/placeorder'>
                        <Nav.Link>Place Order</Nav.Link>
                    </LinkContainer>
                )      : (
                    <Nav.Link disabled>Place Order</Nav.Link>
                )}
            </Nav.Item>

            
        </Nav>
       
    )
}

export default CheckoutSteps
